import React, { useEffect, useState } from 'react'

function Fapi() {
  const [data,setData] = useState([]);
    const api = ()=>{
        fetch('http://127.0.0.1:8000/mcq/')
        .then((response) => response.json())
        .then((json)=>{
          console.log(json)
          setData(json)
        })
    }
    useEffect(()=>{
      api()
    },[])
  return (
    <div>
      <button onClick={api}></button> 
      <pre>{JSON.stringify(data,null,2)}</pre>
    </div>
  )
}

export default Fapi
